const SearchBar = () => {
    const [input, setInput] = useState('');

    return <form>
        <input
            text='type stock or ticker'
            title='Search a Stock'
            value={input}
            onChange={event => setInput(event.target.value)}
        />
    </form>
}

export default SearchBar;
